import React from 'react';
import group from '../photos/group.jpg'
import styled from 'styled-components'
import { FaHeart, FaGlobeEurope, FaRocketchat } from "react-icons/fa";


const Div = styled.div`
margin-top: 100px;
width:100vw;
height:70vh;
background: url(${group});
background-position:center;
background-repeat:no-repeat;
background-size:cover;
background-attachment: fixed;
background: green;
background-blend-mode:color;
`

const H1 = styled.h1`
color:#404040;
text-align:center;
background:white;
`

const Wrapper = styled.div`
background: white;
text-align:center;
padding:20px;
margin-top: 150px;
`

const Item = styled.div`
    display:inline-block;
    margin:30px;
`


function Advantages() {
    return (
        <Div >
            <H1>Genom oss har 42 000 människor hittat sin perfekta partner.
                Försök, det är gratis att gå med.</H1>
            <Wrapper>
                <Item>
                    <FaHeart size={70} />
                    <h2>naslov</h2>
                    <h3>malo vise ovo ono asdasd asdkasd </h3>
                </Item>
                <Item>
                    <FaGlobeEurope size={70} />
                    <h2>naslov</h2>
                    <h3>malo vise ovo ono asdasd asdkasd </h3>
                </Item>
                <Item>
                    <FaRocketchat size={70} />
                    <h2>naslov</h2>
                    <h3>malo vise ovo ono asdasd asdkasd </h3>
                </Item>
            </Wrapper>
        </Div>
    );
}

export default Advantages;
